import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
// import Avatar from '@mui/material/Avatar'; // Auskommentiert, da im User-Code auskommentiert
import Button from '@mui/material/Button';
// import Tooltip from '@mui/material/Tooltip'; // Auskommentiert, da im User-Code auskommentiert
import MenuItem from '@mui/material/MenuItem';
import AdbIcon from '@mui/icons-material/Adb'; // Behalten als Logo-Beispiel

// Die 'pages' aus deinem Code
const pages = ['Home', 'Ergebnisse', 'Historiker-Ecke', 'Kontakt', 'Teams']; 
// Die 'settings' aus deinem Code (bleiben vorerst auskommentiert, wie in deinem Snippet)
// const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

function Header() { // Umbenannt von ResponsiveAppBar zu Header, passend zu deinem Code
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  // const [anchorElUser, setAnchorElUser] = React.useState(null); // Auskommentiert

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
    console.log(event.currentTarget) // Dein console.log beibehalten
  };
  // const handleOpenUserMenu = (event) => { // Auskommentiert
  //   setAnchorElUser(event.currentTarget);
  // };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  // const handleCloseUserMenu = () => { // Auskommentiert
  //   setAnchorElUser(null);
  // };

  return (
    // Dein AppBar Styling beibehalten
    <AppBar position="sticky" sx={{ backgroundColor: '#222' }} className="rounded-lg"> 
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          {/* Desktop Logo */}
          <AdbIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="#app-bar-with-responsive-menu" // Dein href
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace', // Dein Font
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            Bunte Liga Freiburg {/* Dein Titel */}
          </Typography>

          {/* Mobiles Menü Icon und Menü */}
          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
            <IconButton
              size="large"
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleOpenNavMenu}
              color="inherit"
            >
              <MenuIcon />
            </IconButton>
            <Menu
              id="menu-appbar"
              anchorel={anchorElNav} // Korrigiert von anchorel zu anchorEl
              anchorOrigin={{
                vertical: 'bottom',
                horizontal: 'right', // Geändert von 'left' zu 'right'
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right', // Geändert von 'left' zu 'right'
              }}
              open={Boolean(anchorElNav)}
              onClose={handleCloseNavMenu}
              sx={{ display: { xs: 'block', md: 'none' } }}
              MenuListProps={{ // Zusätzliche Stile für das Menü selbst
                className: 'bg-white dark:bg-gray-800 shadow-lg rounded-md',
              }}
            >
              {pages.map((page) => (
                <MenuItem 
                  key={page} 
                  onClick={handleCloseNavMenu}
                  // Tailwind Klassen für besseres Aussehen der Menüpunkte
                  className="text-gray-700 dark:text-gray-200 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md"
                >
                  {/* Dein Typography für Menüpunkte */}
                  <Typography sx={{ textAlign: 'center' }}>{page}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box>

          {/* Mobiles Logo */}
          <AdbIcon sx={{ display: { xs: 'flex', md: 'none' }, mr: 1 }} />
          <Typography
            variant="h5" // Dein variant war h7, MUI Standard ist eher h5 oder h6 für AppBar Titel
            noWrap
            component="a"
            href="#app-bar-with-responsive-menu" // Dein href
            sx={{
              mr: 2,
              display: { xs: 'flex', md: 'none' },
              flexGrow: 1,
              fontFamily: '', // Dein Font
              fontWeight: 700,
              letterSpacing: '.2rem', // Dein letterSpacing
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            Bunte Liga Freiburg {/* Dein Titel */}
          </Typography>

          {/* Desktop Navigationselemente */}
          <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' }, justifyContent: 'flex-end' }}> {/* Sorgt dafür, dass die Buttons rechts sind */}
            {pages.map((page) => (
              <Button
                key={page}
                onClick={handleCloseNavMenu}
                sx={{ my: 2, color: 'white', display: 'block', '&:hover': { backgroundColor: 'rgba(255,255,255,0.1)'} }}
                className="rounded-md"
              >
                {page}
              </Button>
            ))}
          </Box>

          {/* Dein User-Menü (Avatar etc.), bleibt auskommentiert */}
          {/* <Box sx={{ flexGrow: 0 }}>
            <Tooltip title="Open settings">
              <IconButton onClick={handleOpenUserMenu} sx={{ p: 0 }}>
                <Avatar alt="Remy Sharp" src="/static/images/avatar/2.jpg" />
              </IconButton>
            </Tooltip>
            <Menu
              sx={{ mt: '45px' }}
              id="menu-appbar-user" // Eindeutige ID für dieses Menü
              anchorEl={anchorElUser}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={Boolean(anchorElUser)}
              onClose={handleCloseUserMenu}
            >
              {settings.map((setting) => (
                <MenuItem key={setting} onClick={handleCloseUserMenu}>
                  <Typography sx={{ textAlign: 'center' }}>{setting}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box> */}
        </Toolbar>
      </Container>
    </AppBar>
  );
}
export default Header; // Exportiere Header
